import React from 'react';
import 'Map.css';
import { LoadScript, GoogleMap } from '@react-google-maps/api';

function Map(props){
    return(
        <LoadScript
        id="script-loader"
        googleMapsApiKey="AIzaSyD8UWoPDZssIjtLLe_ogggrymmRyrg_71E"
         >
        <GoogleMap
          id='example-map'
          zoom = {10}
          center = {{lat: props.lattitude, long: props.longitude}}
        >
        </GoogleMap>
      </LoadScript>
    )
}

export default Map();
